import React, {useState} from 'react';
import {contextAuth} from "./utils/Context";
import Sign from "./components/Sign";
import {ToastContainer} from "react-toastify";
function App() {
  const [user, setUser] = useState({name: "Jhairo"})
  //return (user ? <h1>Estas logueado</h1> : <h1>No estas logueado</h1> );
  return (
    <contextAuth>
      {user ? "Usuario Logurado" : <Sign /> }
      <ToastContainer 
        position="top-right"
        autoClose={5000}
        hideProgressBar
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
      />
    </contextAuth>
  );
} 
export default App;
